import styled from 'styled-components';

export const LandingPageBodyContainer = styled.div`

  margin: 0px;
  background-color: #4285f4;
   
`;


export const LandingPageMainContainer = styled.div`
    width : 100%;
    height: 100%;
    position: absolute;
    overflow: hidden;
`;

export const Box1 = styled.div`
    width: 530px;
    height: 625px;
   // background-image:url('');
    position: absolute;
    bottom: -100%;
    left: 30%;
    animation: anim 2s forwards, anim2 3s forwards 3s; 

    &:after {
        content: '';
        position: absolute;
        width: 530px;
        height: 625px;
        //background-image()
        left:0px;
        z-index: -1;
    }

`;
